import React from "react";
import "./SkillBar.scss";

export default function SkillBar({ name, level, color }) {
  return (
    <div className="bar-1">
      <div className="title" style={{ color: "#525252" }}>
        {name}
      </div>
      <div className="bar">
        <div className="bar-inner" style={{ background: color }}></div>
        <div className="bar-percent">95%</div>
      </div>
    </div>
  );
}
